module.exports = "<style include=\"shared-styles\">\n  :host {\n    display: block;\n  }\n\n  .root {\n    display: flex;\n    justify-content: center;\n  }\n  .root > div {\n    width: 100%;\n    max-width: 1200px;\n    min-height: 600px;\n  }\n</style>\n\n<div class=\"root\">\n    <div class=\"main-panel\">\n      <h2>About</h2>\n      <p>EcoSML is part of the <a href=\"https://cce.nasa.gov/cgi-bin/cce/cce_profile.pl?project_group_id=3766\" target=\"_blank\">EcoSIS Toolkit</a>, \n        which is funded by NASA’s Earth Science Technology Office ESTO) \n        through the Advanced Information Systems Technology (AIST) Program (Grant Number: 80NSSC17K0244).</p>\n\n      <p>The EcoSIS Toolkit is an extension of <a href=\"https://ecosis.org\" target=\"_blank\">EcoSIS.org</a>, \n        which is online open-source database of ecologically \n        oriented spectral measurements and associated metadata such as leaf or plant morphological and chemical \n        measurements. EcoSIS is a repository to store your spectral data for distribution to the larger scientific \n        community, as required by granting agencies and journals. EcoSIS enables data discovery and integration \n        across datasets through a web-based search or an API. EcoSIS provides contributors with a DOI to enable \n        long-term archiving and accessibility.</p>\n\n      <p>EcoSML.org is part of the EcoSIS Toolkit. EcoSML stand for the EcoSIS Spectral Model Library. One of the \n        major uses of spectral data such as you might find in EcoSIS is the development of spectral models to \n        predict vegetation traits such as leaf mass per area, chlorophyll content, water content or nitrogen \n        concentration.  <b>EcoSML is meant to be a repository for the spectral models that people use to \n        predict variables of interest from spectral data</b> (spectral data can include image, canopy  (proximal) \n        or leaf level data). EcoSML provides both coefficients (e.g., for models built using partial least-squares \n        regression, PLSR) and code needed by users to apply a spectral model to their data.</p>\n\n      <p>Researchers provide details and resources to create model packages that include coefficients, error parameters, \n        demonstration data, and code. Users will be able to browse models, explore example code, and test outputs. Model \n        packages will be installable via common package managers like Python's PyPI/pip, as well as R's CRAN.</p>\n\n      <p>\n          EcoSML accommodates any model forms that can be imbedded in code. At present this includes PLSR and Gaussian \n          Process Models, and will be expanded to accept other model formats.\n      </p>\n\n      <div>EcoSML’s primary objectives:</div>\n      <ul>\n        <li>Serve as a widely-accessible online repository where researchers can offer spectroscopy-derived models to \n          the science community</li>\n        <li>Provide a robust API that allows direct links with EcoSIS.org, and various open-source software or \n          desktop softwares users may have.\n          </li>\n      </ul>\n\n      <div style=\"text-align: center\">\n        <img style=\"max-width: 600px; width: 100%\" src=\"/images/linkages.png\" />\n      </div>\n\n      <h2>Personnel:</h2>\n      <ul>\n        <li><b>PI</b> <a target=\"_blank\" href=\"https://forestandwildlifeecology.wisc.edu/people/faculty-and-staff/philip-townsend/\">Philip Townsend</a></li>\n        <li><b>Project Manager</b> Erin Wagner</li>\n        <li><b>Lead Developer</b> <a target=\"_blank\" href=\"https://github.com/jrmerz\">Justin Merz</a></li>\n      </ul>\n    </div>\n</div>\n";

